import React, { useEffect, useState } from "react";
import { APIProvider, Map, Marker } from '@vis.gl/react-google-maps';
import { Link } from "react-router-dom";
import logo from './logo.png';

const AddProperty = () => {
    const [markers, setMarkers] = useState([]);
    const [height, setHeight] = useState(0); // Height state
    const position = { lat: 6.8214925581511565, lng: 80.04122509763354 };

    const ClearOutput = () => {
        const Name = document.getElementById('Property_Name');
        const Phone = document.getElementById('Phone_No');
        const Description = document.getElementById('Description');
        const Facilities = document.getElementById('Available_Facilities');
        const Available_For = document.getElementById('Available_For');
        const Price = document.getElementById('Price');
        const Address = document.getElementById('Address');
        const Photos = document.getElementById('Photos');

        if (!(Description === "") || !(Facilities === "") || !(Name === "") || !(Available_For === "") || !(Price === "") || !(Address === "") || !(Photos === null)) {
            Name.value = "";
            Phone.value = "";
            Description.value = "";
            Facilities.value = "";
            Available_For.value = "";
            Price.value = "";
            Address.value = "";
            Photos.value = null;
        }
        setMarkers([]);
    };

    useEffect(() => {
        const column2 = document.getElementById('column_two');
        if (column2) {
            setHeight(column2.offsetHeight);
        }
    }, []);

    const handleMapClick = (event) => {
        if (event && event.detail && event.detail.latLng) {
            const clickedPosition = {
                lat: event.detail.latLng.lat,
                lng: event.detail.latLng.lng
            };
            setMarkers([...markers, clickedPosition]);
        }
    };

    return (
        <APIProvider apiKey={"YOUR_API_KEY"}>
            <>
                <nav>
                    <div className="logo">
                        <img src={logo} alt="Logo" width="100" height="100" />
                    </div>
                    <Link to="/Home" title="Home"><b>Home</b></Link>
                    <Link to="/WardenDashbord" title="Dashboard"><b>Dashboard</b></Link>
                    <Link to="/WardenProfile" title="Profile"><b>Profile</b></Link>
                    <Link to="/WardenProperty" title="Reservations"><b>Property</b></Link>
                    <Link to="/Home" title="Profile" style={{ marginRight: '-10px' }}><b>Sign Out</b></Link>
                </nav>

                <article style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', minHeight: 'calc(100vh - 100px)' }}>
                    <div className="bg-light-gray p-5 rounded" style={{ maxWidth: '600px', width: '100%' }}>
                        <h1 className="mb-5 text-center">Add New Property</h1>
                        <form>
                            <div className="mb-4">
                                <label className="block mb-2 font-bold" htmlFor="Property_Name">Property Name</label>
                                <input className="w-full px-3 py-2 border rounded" type="text" name="Property_Name" id="Property_Name" />
                            </div>
                            <div className="mb-4">
                                <label className="block mb-2 font-bold" htmlFor="Description">Description</label>
                                <input className="w-full px-3 py-2 border rounded" type="text" name="Description" id="Description" />
                            </div>
                            <div className="mb-4">
                                <label className="block mb-2 font-bold" htmlFor="Address">Address</label>
                                <input className="w-full px-3 py-2 border rounded" type="text" name="Address" id="Address" />
                            </div>
                            <div className="mb-4">
                                <label className="block mb-2 font-bold" htmlFor="Available_Facilities">Available Facilities</label>
                                <input className="w-full px-3 py-2 border rounded" type="text" name="Available_Facilities" id="Available_Facilities" />
                            </div>
                            <div className="mb-4">
                                <label className="block mb-2 font-bold" htmlFor="Phone_No">Phone No</label>
                                <input className="w-full px-3 py-2 border rounded" type="tel" name="Phone_No" id="Phone_No" />
                            </div>
                            <div className="mb-4">
                                <label className="block mb-2 font-bold" htmlFor="Available_For">Available For</label>
                                <select className="w-full px-3 py-2 border rounded" id="Available_For" name="Available_For">
                                    <option value="Male">Male</option>
                                    <option value="Female">Female</option>
                                    <option value="Both">Both</option>
                                </select>
                            </div>
                            <div className="mb-4">
                                <label className="block mb-2 font-bold" htmlFor="Price">Price</label>
                                <input className="w-full px-3 py-2 border rounded" type="number" name="Price" id="Price" />
                            </div>
                            <div className="mb-4">
                                <label className="block mb-2 font-bold" htmlFor="Photos">Photos</label>
                                <input className="w-full px-3 py-2 border rounded" type="file" name="Photos" id="Photos" />
                            </div>
                            <div className="flex justify-center">
                                <input className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded mr-2" type="submit" value="Add" />
                                <input className="bg-gray-400 hover:bg-gray-600 text-white font-bold py-2 px-4 rounded" type="reset" value="Clear" onClick={ClearOutput} />
                            </div>
                        </form>
                    </div>
                </article>
                <footer className="footer">
                    <small className="copyright">© Created by Group CC, All Rights Reserved.</small>
                </footer>
            </>
        </APIProvider>
    );
}

export default AddProperty;
